import React from 'react';
import Navigation from './components/Navigation'
import './App.css';
import Home from './components/Home';
import { Container, Row, Col } from 'react-bootstrap';


function App() {
  return (
      <div className="App">
        <Container className="layout">
          <Row>
            <Col>
                <Navigation />
                <h1 className="brand-name">SHIVESH SHARMA</h1>
                <h3 className="work">BACKEND DEVELOPER</h3>
            </Col>
          </Row>
        </Container>  
        <Home />
      </div>

  );
}

export default App;
